import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LandingPage from './components/LandingPage';
// Import other components

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={LandingPage} />
        {/* Define other routes */}
      </Switch>
    </Router>
  );
}

export default App;
